import Vue from 'vue'
import App from './App.vue'
import router from './router'
import vuetify from './plugins/vuetify'

Vue.config.productionTip = false

new Vue({
  router,
  vuetify,
  
  beforeMount() {
    window.addEventListener('beforeunload', function(event) {
      localStorage.clear();
   }, false);
  },
  beforeDestroy() {
    window.addEventListener('beforeunload', function(event) {
      localStorage.clear();
   }, false);
  },
}).$mount('#app')
